import * as React from 'react';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Link from '@mui/material/Link';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { CssBaseline } from '@mui/material';
import { FormattedMessage } from 'react-intl';

// Replace these with your custom components
import { ButtonForAuthentication } from '../../components/primary-btn/PrimaryButton';
import { CheckBox } from '../../components/form-fields/checkboxes/CheckBox';
import { TextFeildForMail } from '../../components/form-fields/mail-text-field/TextFeildForMail';
import { TextFeildForPassword } from '../../components/form-fields/password-text-feild/TextFeildForPassword';
import { LockOutlined } from '../../components/lock_outlined_Icon/LockOutlined';
import { AuthHead } from '../../components/auth-heading-typography/AuthHeadingTypography';
import img from '../../assets/note.jpg';

import { useLocalization } from '../../locales/LocalizationContext';

export default function Home() {
    const { locale, translations } = useLocalization();
    const signInTranslations = translations[locale].signIn;
    const paperStyle = { width: 1200 };

    return (
        <>
            <Grid container justifyContent="center">
                <Paper elevation={10} style={{ ...paperStyle, minHeight: '70vh', marginTop: '10vh' }}>
                    <Grid container justifyContent="center" style={{ height: '100%' }}>
                        <Grid item xs={12} sm={6}>
                            <img src={img} alt="Note image" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Container component="main" maxWidth="xs">
                                <CssBaseline />
                                <Box
                                    sx={{
                                        display: 'flex',
                                        flexDirection: 'column',
                                        alignItems: 'center',
                                        marginTop: '63px',
                                    }}
                                >
                                    <LockOutlined />
                                    <AuthHead name={<FormattedMessage id={signInTranslations.signInTitle} />} />
                                    <Box component="form" noValidate sx={{ mt: 1 }}>
                                        <TextFeildForMail />
                                        <br />
                                        <TextFeildForPassword />
                                        <CheckBox name={<FormattedMessage id={signInTranslations.rememberMe} />} />
                                        <ButtonForAuthentication name={<FormattedMessage id={signInTranslations.signInButton} />} />
                                        <br />
                                        <Grid container>
                                            <Grid item xs>
                                                <Link href="/forgotPassword" variant="body2" style={{ textDecoration: 'none' }}>
                                                    <FormattedMessage id={signInTranslations.forgotPasswordLink} />
                                                </Link>
                                            </Grid>
                                            <Grid item style={{ display: 'flex' }}>
                                                <Typography>
                                                    <FormattedMessage id={signInTranslations.dontHaveAccount} />
                                                </Typography>
                                                &nbsp; &nbsp;
                                                <Link href="/register" variant="body2" style={{ textDecoration: 'none' }}>
                                                    <FormattedMessage id={signInTranslations.signUpLink} />
                                                </Link>
                                            </Grid>
                                        </Grid>
                                    </Box>
                                </Box>
                                <br />
                                <br />
                                <br />
                                <br />
                            </Container>
                        </Grid>
                    </Grid>
                </Paper>
            </Grid>
        </>
    );
}
